CREATE TABLE `workplace_DB`.`office` (
  `office_id` INT NOT NULL AUTO_INCREMENT,
  `max_capacity` INT NOT NULL,
  `street_address` VARCHAR(60) NOT NULL,
  `city` VARCHAR(60) NOT NULL,
  `state` VARCHAR(2) NOT NULL,
  `phone` VARCHAR(20) NOT NULL,
  PRIMARY KEY (`office_id`));
  
  
  CREATE TABLE `workplace_DB`.`employee` (
  `employee_id` INT NOT NULL AUTO_INCREMENT,
  `first_name` VARCHAR(30) NOT NULL,
  `last_name` VARCHAR(30) NOT NULL,
  `job_title` VARCHAR(60) NULL,
  `employment_status` VARCHAR(20) NULL,
  `email` VARCHAR(45) NOT NULL,
  `department_name` VARCHAR(45) NULL,
  `office_id` INT NULL,
  PRIMARY KEY (`employee_id`),
  UNIQUE INDEX `email_UNIQUE` (`email` ASC) VISIBLE,
  INDEX `office_id_idx` (`office_id` ASC) VISIBLE,
  CONSTRAINT `office_id`
    FOREIGN KEY (`office_id`)
    REFERENCES `workplace_DB`.`office` (`office_id`)
    ON DELETE SET NULL
    ON UPDATE CASCADE);
    
SELECT * FROM employee;
SELECT * FROM office;

drop table office;
drop table employee;

SELECT o.office_id, o.max_capacity, COUNT(*) as office_capacity
FROM office o
JOIN employee e ON o.office_id = e.office_id
GROUP BY o.office_id;

